import React from "react";
function StickyBlockBox(props) {
  const { list } = props;
  return (
    <div>
      {list.map((item, index) =>
        true(
          <div>
            <ul>
              <li>{item.name}</li>
            </ul>
          </div>
        )
      )}
    </div>
  );
}
export default StickyBlockBox;
